import React from 'react'; 
import {Button, Modal} from 'react-bootstrap';

const ModalV = ()=>{
    const { showSucess, sucess,getUserId,modleShow,deleteConfirm,handleRemove,handleSucces} = props ;
    return(
        <div>
            { 
                getUserId ?
                    <Modal show={modleShow} onHide ={deleteConfirm} > 
                        <Modal.Body>Are you sure!</Modal.Body>
                        <Modal.Footer>
                        <Button variant="secondary" onClick ={()=>deleteConfirm(false)}  >
                            Close
                        </Button>
                        <Button variant="primary" onClick ={()=>{handleRemove(getUserId);deleteConfirm(false)}}>
                            delete
                        </Button>
                        </Modal.Footer>
                    </Modal> :''
                }
                { 
                    sucess ?
                        <Modal show={showSucess} size ="sm" onHide ={handleSucces}> 
                            <Modal.Body>{sucess}</Modal.Body> 
                        </Modal> :''
                }
        </div>
    )
}
export default ModalV
